script: |
  super -f text -I q11432.spq | sort > q11432.out

inputs:
  - name: q11432.spq
    data: |
      SELECT ALL col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 90 + ( - col1 + - 8 ) * + 26 NOT BETWEEN ( - col0 / - ( col0 ) ) AND - 97 * col1 AND NULL IS NULL;
  - name: tab1

outputs:
  - name: q11432.out
    data: |
